import React, { useState, useEffect } from 'react'

export default function TripsList() {

  const [trips, setTrips] = useState([])

  console.log(trips)

  useEffect(() => {
    fetch("http://localhost:3000/trips")
    .then( response => response.json())
    .then(json => setTrips(json))

  }, [])



  return (
    <div>
        <h2>Trip List</h2> 
    </div>
  )
}
